                    <button key={tab} onClick={() => onTabClick(tab)} className={`px-4 py-2 rounded ${activeTab === tab ? 'bg-gray-700' : ''}`}>{tab}</button>
                ))}
            </div>
            <div>
                <button onClick={onAdminPanel} className="px-4 py-2 rounded bg-blue-600 mr-2">Admin</button>
